import React from 'react'

function NotLoggedUser() {
    return (
        <div>
            <h1>Log in to see this page.</h1>
            <Link to="signup">
                <button className="btn btn-primary">Log In</button>
            </Link>
        </div>
    )
}

export default NotLoggedUser
